import React from "react";
import "../assets/css/Section1.css";
import Img2065 from '../assets/img/Grupo_2065.png'

function Section1() {
  return (
    <div className="Section1">
        <div>
          <div>
            <img src={Img2065} alt=""/>
          </div>
          <div>
            <h3>La fórmula de la semana</h3>
            <span>Tú tranqui que ya fue analizada, testeada y aprobada</span>
          </div>  
        </div>
    </div>
  );
}

export default Section1;
